import React from 'react';
import SurveyComponent from './SurveyComponent';
const Questionnaire = () => {
  return (
    <div className='w-full h-screen bg-[#0a192f] text-gray-300'>
      <SurveyComponent></SurveyComponent>
    </div>
  );
};

export default Questionnaire;
